import { css } from "styled-components";

export const fontColor = {
  backgroundBlendPink: "pink",
  lightColor: css`
    color: gainsboro;
  `,
  mainColor: css`
    color: black;
  `,
  mainLightColor: css`
    color: white;
  `,
  subColor: css`
    color: grey;
  `,
  redColor: css`
    color: red;
  `
};

export const defaultFontSize = css`
  font-size: 1.6rem;
`;
